The Alex Jones Show

Monday February 23th, 2009.


Hour-1: News and rants
Hour-2: Webster Tarpley and open lines
Hour-3: One more call with Webster Tarpley, then Chip Harrison
Hour-4: Open lines, news and Ted Anderson


Alex talks with Chip Harrison, the Oklahoma man who had a &quot;Abort Obama, not the unborn&quot; bumper sticker confiscated by the police. Alex also talks with author, researcher, and radio talk show host Webster Griffin Tarpley about Obama and censorship. Alex also discusses the issues of the day and takes your calls.

